import Vue from "vue";
import VueRouter from "vue-router";
import AddOrder from "@/components/AddOrder";
import MyShop from "@/components/MyShop";
import MyOrder from "@/components/MyOrder";
import DelShop from "@/components/DelShop";
import DelLocation from "@/components/DelLocation";

import AddShop from "@/components/AddShop";

Vue.use(VueRouter)
const vueRouter = new VueRouter({
    routes:[
        {path:'/AddOrder',component:AddOrder,name:'AddOrder'},
        {path:'/MyShop',component:MyShop,name:'MyShop'},
        {path:'/MyOrder',component:MyOrder,name:'MyOrder'},
        {path:'/DelShop',component:DelShop,name:'DelShop'},
        {path:'/DelLocation',component:DelLocation,name:'DelLocation'},
        {path:'/AddShop',component:AddShop,name:'AddShop'},

    ]
});
export default vueRouter
